```sparql
PREFIX dbpedia: <http://dbpedia.org/resource/>
PREFIX dbo: <http://dbpedia.org/ontology/>

SELECT ?result
WHERE {
    # Find Tony Hollings' birthdate
    dbpedia:Tony_Hollings dbo:birthDate ?tonyBirthDate .

    # Find individuals born on the same day as Tony Hollings who are athletes, soccer players, sports managers, and soccer managers
    ?person dbo:birthDate ?tonyBirthDate ;
             a dbo:Athlete ;
             a dbo:SoccerPlayer ;
             a dbo:SportsManager ;
             a dbo:SoccerManager .

    # Identify the manager of Hong Kong C who is both a sports manager and a soccer manager
    dbpedia:Hong_Kong_C dbo:manager ?manager .
    ?manager a dbo:SportsManager ;
              a dbo:SoccerManager .

    # Determine which team this manager is associated with that matches all given criteria
    ?team dbo:manager ?manager ;
           a dbo:Organisation ;
           a dbo:SportsClub ;
           a dbo:SportsTeam ;
           a dbo:SoccerClub .

    # The person should be part of this team
    ?person dbo:team ?team .

    # Bind the result
    BIND(?person AS ?result)
}
```

